import { ChatEngine } from 'react-chat-engine';
import './App.css' ;
import ChatFeed from './components/ChatFeed';

const App = () => {
  return (
      <ChatEngine
        height="100vh"
        projectID="cb9d20f0-6b63-4bf6-9425-42adb45b239f"
        userName="bitupanpatowary@gmail.com"
        userSecret="12345"
        renderChatFeed={(chatAppProps) => <ChatFeed {...chatAppProps} /> }
      />
  )
}

export default App
